    super(props);
    this.state = {
      allTransaction : [],
    }

  }

  componentDidMount = async()=>{
    const query = await db.collection("transaction").get();
    query.docs.map((doc)=>{
      this.setState({})
    })
  }

    render() {
      return (
        <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
          <Text>Search</Text>
        </View>
      );
    }

  }
